import { useEffect, useState } from "react";

function Home() {
  const [movie, setMovie] = useState();

  useEffect(() => {
    getMovies();
  }, []);

  async function getMovies() {
    const api = await fetch(
      `https://api.themoviedb.org/3/movie/550?api_key=${process.env.REACT_APP_TMBD_KEY}}`
    );
    const result = await api.json();
    setMovie(result);
    console.log(result);
  }

  return (
    <div>
      {movie.map((d) => {
        <li>{d}</li>;
      })}
    </div>
  );
}

export default Home;
